import React from 'react'
import {useState} from 'react'
import styled from 'styled-components'




const App=()=>{

    const [num,setNum]=useState(0)

    function incbyone(){
        setNum(num+1)
    }

    function decbyone(){
        setNum(num-11)
    }


    return (
        <>

           <Button onClick={incbyone}>+</Button>
           
           <h1>Hello App {num}</h1>
           
           <Button>-</Button>


        </>

    )
}


const Button=styled.button`
   width:50px;
   height:50px;


`;

export default App;
